import React from "react";
import styled from "styled-components";

const ASideTopPresenter = styled.div`
  background-color: #1d41f0;
  width: 240px;
  height: 55px;
  margin-left: 56px;
  border-top: 1.4px solid #1e7efa;
`;

export default ASideTopPresenter;
